from typing import List, Tuple

class Solution:
    def increasingTriplet(self, nums: List[int]) -> bool:
        count: int = 0
        max_int: int = max(nums)
        for i in range(len(nums) - 2):
            if max_int == nums[i]:
                continue
            for j in range(i+1, len(nums) - 1):
                if nums[i] >= nums[j]:
                    continue
                if max_int == nums[j]:
                    continue
                for k in range(j+1, len(nums)):
                    if nums[j] < nums[k]:
                        return True

        return False

